
/* Check that very long function names are safely truncated in 
   memcheck's XML output. */

#if defined(_AIX)

#include <stdio.h>
int main () { 
   printf("This test is not compilable on AIX using gcc.\n");
   return 0;
}



#else

#include <iostream>
#include <stdlib.h>
using namespace std;

namespace  {
  namespace  {
    void f() {
      cout << "I'm in an asininely long namespace!" << endl;
      char *ptr = (char *)malloc (4);
      ptr[5] = 0;
      free(ptr);
    }
  }
}

int main() {
  ::::f();
  return 0;
}

#endif /* defined(_AIX) */
